import React from "react";
import { Box, Text } from "@chakra-ui/react";

export default function Logo() {
  return (
    <Stack direction="row" spacing={4}>
            <Logo />
            <Button colorScheme="teal" variant="solid">
                Email
            </Button>
            <Button colorScheme="teal" variant="outline">
                Call us
            </Button>

        </Stack>
  );
}
